Fie punctul $P=(x,y)$ pe graficul funcției $y=\frac{1}{\sqrt{2}}\left(x^2-3\right)$. Atunci distanța de la punctul $P$ la origine este
\begin{align*} OP&=\sqrt{x^2+y^2}=\sqrt{x^2+\frac{1}{2}\left(x^2-3\right)^2}=\sqrt{x^2+\frac{1}{2}\left(x^4-6x^2+9\right)}\\ &=\sqrt{\frac{1}{2}x^4-2x^2+\frac{9}{2}}=\sqrt{\frac{1}{2}\left(x^4-4x^2+4\right)+1}=\sqrt{\frac{1}{2}\left(x^2-2\right)^2+1} \end{align*}
Din ultima expresie se observă că $OP\geq 1$. De asemenea, $OP=1$ dacă și numai dacă $x=\pm\sqrt{2}$, adică $P$ este punctul $(\sqrt{2},-1)$ sau $(-\sqrt{2},-1)$. Deci, cea mai mică distanță este 1, adică $\sqrt{a}/b=\sqrt{1}/1$, deci $a+b=\boxed{2}$.

Fie $c$ costul unui creion și $r$ costul unei radicijane jumbo. Atunci putem scrie ecuațiile
\begin{align*}
3c+r&=124\quad(1)\\
5c+r&=182\quad(2)
\end{align*}
Subtracting $(1)$ from $(2)$, we get $2c=58$, so $c=\boxed{29}$ cente.
